import React from "react";

const WrapperOne = () => {
	const data = [
		{
			num: "520%",
			text: "AWARDS WINNING",
		},
		{
			num: "99%",
			text: "SATISFIED CLIENTS",
		},
		{
			num: "3325",
			text: "CREATIVE PROJECTS",
		},
		{
			num: "54380",
			text: "LINES OF CODE ",
		},
	];
	return (
		<>
			<section className="branding wrapperOne">
				<div className="container grid2">
					{
						data.map((val) => {
							return (
								<>
									<div className="box">
										<h1>{val.num}</h1>
										<p>{val.text}</p>
									</div>
								</>
							);
						})
					}
				</div>
			</section>
		</>
	);
};

export default WrapperOne;
